import React from "react"; 
import { useState } from "react";
import { Link } from "react-router-dom";
const Footer=()=>{
    const[names,setname]=useState()
    function tryit(){
        const name=["hi","hello","hai"]
        const need=Math.floor(Math.random()*3)
        setname(name[need]);
        }
    return(<div><p>This can change randomly    {names}</p>
         <button onClick={tryit}>press to change </button>
         <nav>
            <Link to ="/copyright">Copyright</Link>
            </nav>
        </div>)
    }
export default Footer
